# Runtime: 3384 ms, faster than 35.83% of Python3 online submissions for Longest Duplicate Substring.
# Memory Usage: 35 MB, less than 22.39% of Python3 online submissions for Longest Duplicate Substring.
# https://leetcode.com/problems/longest-duplicate-substring/discuss/1548431/Learning-notes-on-Rabin-Karp-algorithm
from numpy import int64
class Solution:
    def longestDupSubstring(self, s: str) -> str:
        if not s:
            return ""
        x, mod, oa = int64(26), int64(1e7+7), ord('a')
        n, result = len(s), ""

        def calc_hash(t: str) -> int64:
            nonlocal x, mod
            result = int64(0)
            for c in t:
                result *= x
                result %= mod
                result += ord(c) - oa
            return result

        def recalc_hash(h: int64, XM1: int64, removed: chr, appended: chr) -> int64:
            nonlocal x, mod
            h -= (ord(removed)-oa) * XM1
            h *= x
            h %= mod
            h += ord(appended)-oa
            return h

        def find_dup_substring(m: int) -> str:
            nonlocal s, x, mod, n
            seen = dict()
            XM1 = int64(1)
            for _ in range(m-1):
                XM1 *= x
                XM1 %= mod
            h = calc_hash(s[:m])
            seen[h] = 0
            for i1 in range(1, n-m+1):
                i2 = i1+m-1
                h, ss = recalc_hash(h, XM1, s[i1-1], s[i2]), s[i1:i1+m]
                if h in seen and s[seen[h]:seen[h]+m] == ss:
                    return ss
                seen[h] = i1
            return ""

        l, r = 0, n
        while r - l > 1:
            m = l + (r-l) // 2
            ss = find_dup_substring(m)
            if not ss:
                r = m
            else:
                l, result = m, ss
        return result


tests = [
    ["aa", "a"],
    ["banana", "ana"],
    ["abcd", ""],
    ["",
     ""]
]


run_functional_tests(Solution().longestDupSubstring, tests)
